import Link from 'next/link';

import styled from 'styled-components'

const Container = styled.div`
  height: 40px;
  display: flex;
  align-items: center;
  justify-content: flex-end;
`

const Navigation = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
`
const A = styled.a`
  margin: 10px 20px;
  text-transform: uppercase;
`
const Header = () => (
    <Container>
      <Link href="/">
        <A>Maazel</A>
      </Link>
      <Navigation>
        <Link href="/">
          <A>home</A>
        </Link>
        <Link href="/releases">
          <A>releases</A>
        </Link>
        <Link href="/contact">
          <A>Contact</A>
        </Link>
      </Navigation>
    </Container>
  );

  export default Header;
